import ezra from "./ezra.jpg" 

function Personal() {
	return(
		<>
			<img src={ezra} alt="ezra profile picture"/>
			<h1>Ezra Yeneneh</h1>
			<p><em>Founder of IMDb top 60 video games<strong><a href="http://www.imdb-top-60-video-games.com/">The IMDb project</a></strong></em></p>
			<p>React , Django, AI ChatBot developer and ALX Software Engineering student. I love work and other most things.</p>
	</>
	);
};

export default Personal;
